import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import "./Services.css";

function MbbsRussia() {
  return (
    <section>
      <Container fluid>
        <Row noGutters={true}>
					<Col>
						<h1 className="service__title">MBBS In Russia</h1>
          </Col>
        </Row>
      </Container>
    </section>
  );
}

export default MbbsRussia;
